import React, {useReducer} from 'react';
import './styles.css' ;
import {todoReducer} from './todoReducer';

const initializerArg = [{

  id:new Date().getTime(), 
  desc:'Learn react', 
  done: false

}];

const TodoApp = () => {

  const [todos] = useReducer(todoReducer, initializerArg);
  console.log(todos);

  return (
    <>
      <h1>TodoApp</h1> 

      <small>Things to do: {todos.length} </small>

      <ul>
        <li>Wake</li>
        <li>Mine</li>
        <li>Farm</li>
      </ul>
    </>
  )}

export default TodoApp;
